import Navigation from './components/nav/Navigation';
function App() {
  let data = {};
  const passLikedMoviesHandler = movieData => {
    data = movieData;
    console.log(data);
  };
  return (
    <div className="App">
      <Navigation />
      {/* -------------- Beginning of router ----------------- */}
      <Router>
        <Routes>
          <Route
            path="/"
            element={<MoviesRoute userLikedMovies={passLikedMoviesHandler} />}
          />
          <Route path="/liked" element={<LikedMovies />} />
        </Routes>
      </Router>
      {/* -------------- End of Router ---------------- */}
    </div>
  );
}

export default App;
